const { Switch } = require("@material-ui/core")
import Pay from "./Pay"
import Success from "./Success"
const App = () => {

    return (
        <Router>
            <Switch>
                <Route path="/pay">
                <Pay />
                </Route>
                <Route path="/success">
                <Success />
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
